import React from "react";
import { StyledPokeThumb } from "../styles/StyledPokeThumb";

const PokeThumb = ({ image, poke }) => (
  <StyledPokeThumb>
    <div>
      <img
        className="clickable img_self"
        src={image}
        alt="moviethumb"
        loading="lazy"
      />
      <h5>{poke.name.toUpperCase()}</h5>
    </div>
  </StyledPokeThumb>
);

export default PokeThumb;
